Category	Feature, Foreign

Starring	Anissa Kate, Mike Angelo, Tiffany Doll, Danny D, Pascal Saint James, Emma Leigh, Ryan Ryder, Rebecca More, Sienna Day, Marc, Dean Van Damme

Mr. Castle and his wife Patricia are at the head of a true media empire. They succeed at everything they do, they are beautiful, they are in love, they are very rich, they go from one success to another and journalists are at their feet. But there is just one thing: Mr. and Mrs. Castle have a very wild daughter, Lana. A real night owl, Lana spends her evenings doing the rounds of social events, pouncing at will on every guy she meets that she fancies with no-one off limits. But one evening, while having passionate sex with handsome Johnny in the toilets of a disco, Lana is surprised by a paparazzo...
